import React from "react"; 
import Content from './Components/Content.jsx'
import Header from './Components/Header'
import Total from './Components/Total'
const App = ()=>{
  const course = {
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10
      },
      {
        name: 'Using props to pass data',
        exercises: 7
      },
      {
        name: 'State of a component',
        exercises: 14
      }
    ]
  }


  return(
    <div>
    <Header course = {course.name}/>
    <Content part1 = {course.parts[0].name} part2 = {course.parts[1].name} part3 = {course.parts[2].name} exercises1 = {course.parts[0].exercises} exercises2 = {course.parts[1].exercises} exercises3 = {parts[2].exercises}/>
    <Total course = {course} exercises1 = {parts[0].exercises} exercises2 = {parts[1].exercise} exercises3 = {parts[2].exercises}/>
    </div>
  )
}

export default App;
